import React from "react"
import MyPostContainer from "../MyPosts/MyPostContainer";
import StatusWithHooks from "../ProfileInfo/ProfileStatus/StatusWithHooks";

const ProfileInfoBar = (props) => {
    return (
        <div className="infobar">
            <div>
                <h3>{props.profile.fullName}</h3>
                <StatusWithHooks status={props.status} updateStatus={props.updateStatus}/>

            </div>
            <MyPostContainer state={props.state}
                             dispatch={props.dispatch}/>
        </div>

    )
}

export default ProfileInfoBar
